import React from "react";
import axiosInstance from "../User/axiosApi";

function AllGroups() {
    async function AllGroups() {
        try {
            const response = await axiosInstance.get('api/groups/');

            return response.data; 

        } catch (error) {
            console.log(error);
        }

    };

    return AllGroups();

}


export default AllGroups;


